27. A process of introducing a desired trait into maize inbred line PHAPT comprising:
(a) crossing PHAPT plants grown from PHAPT seed, representative seed of which has been deposited under ATCC Accession No. PTA-7759, with plants of another maize line that comprise a desired trait to produce F1 progeny plants, wherein the desired trait is selected from the group consisting of male sterility, site-specific recombination, increased transformability and abiotic stress tolerance;
(b) selecting F1 progeny plants that have the desired trait to produce selected F1 progeny plants;
(c) crossing the selected progeny plants with the PHAPT plants to produce backcross progeny plants;
(d) selecting for backcross progeny plants that have the desired trait and physiological and morphological characteristics of maize inbred line PHAPT to produce selected backcross progeny plants; and
(e) repeating steps (c) and (d) three or more times in succession to produce selected fourth or higher backcross progeny plants that comprise the desired trait and all of the physiological and morphological characteristics of maize inbred line PHAPT listed in Table 1 as determined at the 5% significance level when grown in the same environmental conditions.

33. A process of introducing a desired trait into maize inbred line PHAPT comprising:
(a) crossing PHAPT plants grown from PHAPT seed, representative seed of which has been deposited under ATCC Accession No. PTA-7759, with plants of another maize line that comprise a desired trait to produce F1 progeny plants, wherein the desired trait is selected from the group consisting of herbicide resistance, insect resistance and disease resistance;
(b) selecting F1 progeny plants that have the desired trait to produce selected F1 progeny plants;
(c) crossing the selected progeny plants with the PHAPT plants to produce backcross progeny plants;
(d) selecting for backcross progeny plants that have the desired trait and physiological and morphological characteristics of maize inbred line PHAPT to produce selected backcross progeny plants; and
(e) repeating steps (c) and (d) three or more times in succession to produce selected fourth or higher backcross progeny plants that comprise the desired trait and all of the physiological and morphological characteristics of maize inbred line PHAPT listed in Table 1 as determined at the 5% significance level when grown in the same environmental conditions.

38. A process of introducing altered grain characteristics trait into maize inbred line PHAPT comprising:
(a) crossing PHAPT plants grown from PHAPT seed, representative seed of which has been deposited under ATCC Accession No. PTA-7759, with plants of another maize line that comprise a desired trait to produce F1 progeny plants, wherein the desired trait is altered phosphorus, antioxidants, fatty acids, essential amino acids or carbohydrates;
(b) selecting F1 progeny plants that have the desired trait to produce selected F1 progeny plants;
(c) crossing the selected progeny plants with the PHAPT plants to produce backcross progeny plants;
(d) selecting for backcross progeny plants that have the desired trait and physiological and morphological characteristics of maize inbred line PHAPT to produce selected backcross progeny plants; and
(e) repeating steps (c) and (d) three or more times in succession to produce selected fourth or higher backcross progeny plants that comprise the desired trait and all of the physiological and morphological characteristics of maize inbred line PHAPT listed in Table 1 as determined at the 5% significance level when grown in the same environmental conditions.
